package java_project;

public class Credit_break_switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int score = 80_100;

switch (score) {

case 80_100: 
System.out.println("score 80_100 is excellent");
break;

case 65_75:
	System.out.println("score1 75  is good");

break;

case 70_80:
	System.out.println("score 70_80  is excellent");	

break;

case 40_60:
	System.out.println("score 40  is low score");

default	:	
	System.out.println("score is not good enough");
}

		
		
		
		
		
		
		
	}

}
